'''Outlaws''' are monsters featured in the [[What Lies Below]] quest, during which they have to be killed in order to obtain five [[Rat's paper]]s that are used to create the [[full folder]]. Outlaws are found in their [[Outlaw Camp|encampment]] near the [[Fairy rings|fairy ring]] west of the [[Grand Exchange]] and north of the shed, which leads into the [[Edgeville Dungeon]]. Like [[Highwayman|highwaymen]], they will shout "Stand and deliver!" They appear to be wielding a [[steel scimitar]] with a recoloured handle.

'''Note:''' Outlaws are not recommended for training [[Combat]] on as they only provide 1/40th of the amount of experience that regular monsters would.

